import {YMaps, Map} from 'react-yandex-maps';

const YandexMaps = () => (
    <YMaps>
        <div className="YMap">
            <Map defaultState={{ center: [55.75, 37.57], zoom: 9, height: 900}} />
        </div>
    </YMaps>
);

export default YandexMaps;
